import type { FC } from "react";
import {ProfileOutlined,DesktopOutlined,LogoutOutlined,ExperimentOutlined,ProjectOutlined} from "@ant-design/icons"

const Profile: FC = () => {
  return <div className=" mt-5 m-auto w-[80%]">
    <div className=" mt-5 min-w-[310px] bg-[#F5F5F5] p-4 m-4   h-fit ">
      <p className="hover:text-[#46A358] ">
      <ProfileOutlined />
        Ma'lumotlarim</p>
      <p className="hover:text-[#46A358] m-10 "> <ExperimentOutlined />Tajribalarim</p>
      <p className="hover:text-[#46A358] "> <ProjectOutlined />Sertifikatlarim</p>
      <p className="hover:text-[#46A358] "> <DesktopOutlined />Qurilmalarim</p>
      <p className="hover:text-[#46A358] "> <LogoutOutlined />Chiqish</p>

    </div>
  </div>;
};

export default Profile;
